var isPolling = false;
if (events.eventId && events.objectType) {
	var isPolling = true;
}

if (isPolling) {
	var providerEvents = [];
	var objectType = events.objectType;
	var objects = Java.from(events[objectType]);
	objects.forEach(function(object) {
		var providerEvent = {};
		var ISODateTimeFormat = Java.type('org.joda.time.format.ISODateTimeFormat');
		var addTime = new Date(ISODateTimeFormat.dateTime().parseDateTime(object.date_created).toString());
		var updateTime = new Date(ISODateTimeFormat.dateTime().parseDateTime(object.date_updated).toString());
		providerEvent.event_object_type = objectType;
		providerEvent.event_date = updateTime.toISOString();
		providerEvent.event_object_id = object.id;
		providerEvent.event_type = addTime - updateTime < 0 ? 'UPDATED' : 'CREATED';
		providerEvents.push(providerEvent);
	});
	return {
		"events": providerEvents
	};
}

var eventObject = {};
var type = events.event;
eventObject.event_date = events.data.date_updated;
eventObject.event_object_id = events.data.id;
eventObject.event_object_type = 'leads';
eventObject.event_type = determineEventType(type);

if (events.data.source_id) {
	eventObject.event_old_path = events.data.source_id;
	eventObject.event_object_id = events.data.source_id;
}

if (events.data.destination_id) {
	eventObject.event_new_path = events.data.destination_id;
}

function determineEventType(eventTypeString) {
	switch (eventTypeString) {
		case 'update':
			return 'UPDATED';
		case 'create':
			return 'CREATED';
		case 'delete':
			return 'DELETED';
		case 'merge':
			return 'UPDATED';
		default:
			return 'UNKNOWN';
	}
}

return {
	"events": [eventObject]
}
